import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './Nav.css';

class navBar extends Component {
  render() {
    return (
      <nav> 
        <ul className="nav > ul">
          <li className="ul > li">
              <div>Memory Statistics</div>
          </li>
          <li className="ul > li">
              <div>Latency Statistics</div>
          </li>
          <li className="ul > li">
              <div>Performance Statistics</div>
          </li>
        </ul>
      </nav>
    );
  }
}
export default navBar;
